style.css:
body {
    margin: 0;
    height: 100vh;
    background: linear-gradient(to bottom, #88c1e3, #b5e4f4 50%, #4c9f50);
    background-image: url('https://example.com/anime-forest.jpg');
    background-size: cover;
    background-position: center;
    background-blend-mode: overlay;
    font-family: 'Arial', sans-serif;
}

h1 {
    color: #fff;
    text-shadow: 2px 2px 5px rgba(0, 0, 0, 0.5);
    text-align: center;
    padding-top: 20vh;
    font-size: 4rem;
}

p {
    color: #e8f0ff;
    text-shadow: 1px 1px 3px rgba(0, 0, 0, 0.5);
    text-align: center;
    font-size: 1.5rem;
    margin-top: 1rem;
}
